import React, { useState, useEffect } from "react";
import {
  Box,
  Button,
  Typography,
  Container,
  Paper,
  Select,
  MenuItem,
  FormControl,
  InputLabel,
} from "@mui/material";

const generateSequence = (length) => {
  const chars = "ABCDEFGHIJKLMNOPQRSTUVWXYZ";
  return Array.from({ length }, () => chars[Math.floor(Math.random() * chars.length)]).join("");
};

export default function FocusGame() {
  const [mode, setMode] = useState("easy");
  const [sequence, setSequence] = useState("");
  const [userInput, setUserInput] = useState("");
  const [score, setScore] = useState(0);
  const [gameOver, setGameOver] = useState(false);
  const [timeLeft, setTimeLeft] = useState(0);

  const difficulty = {
    easy: { length: 3, time: 5 },
    medium: { length: 5, time: 4 },
    hard: { length: 7, time: 3 },
  };

  useEffect(() => {
    if (timeLeft <= 0) return;
    const timer = setTimeout(() => setTimeLeft((t) => t - 1), 1000);
    return () => clearTimeout(timer);
  }, [timeLeft]);

  const startGame = () => {
    setScore(0);
    setGameOver(false);
    nextRound();
  };

  const nextRound = () => {
    const { length, time } = difficulty[mode];
    setSequence(generateSequence(length));
    setUserInput("");
    setTimeLeft(time);
  };

  const handleSubmit = () => {
    if (userInput.toUpperCase() === sequence) {
      setScore((s) => s + 1);
      nextRound();
    } else {
      setGameOver(true);
    }
  };

  const focusLevel =
    score >= 10 ? "Your focus is high" :
    score >= 5 ? "Your focus is intermediate" :
    "Your focus is low";

  return (
    <Container maxWidth="sm" sx={{ py: 4 }}>
      <Paper elevation={3} sx={{ p: 4, textAlign: "center" }}>
        <Typography variant="h4" gutterBottom>Focus Test Game</Typography>
        <FormControl fullWidth sx={{ mb: 2 }}>
          <InputLabel>Mode</InputLabel>
          <Select
            value={mode}
            onChange={(e) => setMode(e.target.value)}
          >
            <MenuItem value="easy">Easy</MenuItem>
            <MenuItem value="medium">Medium</MenuItem>
            <MenuItem value="hard">Hard</MenuItem>
          </Select>
        </FormControl>
        {gameOver ? (
          <>
            <Typography variant="h5" gutterBottom>{focusLevel}</Typography>
            <Typography variant="body1">Score: {score}</Typography>
            <Button onClick={startGame} variant="contained" sx={{ mt: 2 }}>Restart</Button>
          </>
        ) : timeLeft > 0 ? (
          <>
            <Typography variant="h6">Time Left: {timeLeft}s</Typography>
            <Typography variant="h5" sx={{ letterSpacing: 2, my: 2 }}>{sequence}</Typography>
            <input
              value={userInput}
              onChange={(e) => setUserInput(e.target.value)}
              onKeyDown={(e) => e.key === "Enter" && handleSubmit()}
              autoFocus
            />
            <Box mt={2}>
              <Button onClick={handleSubmit} variant="contained">Submit</Button>
            </Box>
          </>
        ) : (
          <Button onClick={startGame} variant="contained">Start</Button>
        )}
      </Paper>
    </Container>
  );
}
